import React from 'react';
import logo from './logo.svg';
import './App.css';

function HelloWorld() { 
  return(
    <div id="hello">Hello world</div>
  )
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>This is my component: <HelloWorld/><HelloWorld/></div>
      </header>
    </div>
  );
}

export default App;
